import Home from "../../pages/Home";
import Login from "../../pages/Login";
import MyInfo from "../../pages/MyInfo";
import PostDetail from "../../pages/PostDetail";

export interface RouterItem {
  path: string;
  element: JSX.Element;
  isLoggedIn: boolean;
  isWithNav: boolean;
  isShowNav: boolean;
  label: string;
}

type RouterItemType = {
  [key: string]: RouterItem;
};

const RouterInfo: RouterItemType = {
  HOME: {
    path: "/",
    element: <Home />,
    isLoggedIn: false,
    isWithNav: true,
    isShowNav: true,
    label: "홈",
  },
  LOGIN: {
    path: "/login",
    element: <Login />,
    isLoggedIn: false,
    isWithNav: false,
    isShowNav: true,
    label: "로그인",
  },
  POST: {
    path: "/posts/:id",
    element: <PostDetail />,
    isLoggedIn: false,
    isWithNav: true,
    isShowNav: false,
    label: "게시물 상세페이지",
  },
  MYINFO: {
    path: "/my",
    element: <MyInfo />,
    isLoggedIn: true,
    isWithNav: false,
    isShowNav: true,
    label: "내 정보",
  },
};

Object.freeze(RouterInfo);

export default RouterInfo;
